### Examples of possible setting overrides for Neural Network

If the user does not override the default settings, then relevant settings are determined by the algorithm.

A complete list of settings can be found in the Documentation link:

-- Algorithm Settings: <a href="https://docs.oracle.com/en/database/oracle/oracle-database/21/arpls/DBMS_DATA_MINING.html#GUID-7793F608-2719-45EA-87F9-6F246BA800D4" onclick="return ! window.open('https://docs.oracle.com/en/database/oracle/oracle-database/21/arpls/DBMS_DATA_MINING.html#GUID-7793F608-2719-45EA-87F9-6F246BA800D4');">Neural Network</a>

-- Shared Settings: <a href="https://docs.oracle.com/en/database/oracle/oracle-database/21/arpls/DBMS_DATA_MINING.html#GUID-24047A09-0542-4870-91D8-329F28B0ED75" onclick="return ! window.open('https://docs.oracle.com/en/database/oracle/oracle-database/21/arpls/DBMS_DATA_MINING.html#GUID-24047A09-0542-4870-91D8-329F28B0ED75');">All algorithms</a>

-- Specify a row weight column 
    v_setlst('ODMS_ROW_WEIGHT_COLUMN_NAME') := '<row_weight_column_name>';

-- Specify a missing value treatment method for the training data. This setting does not affect the scoring data. The default value is `ODMS_MISSING_VALUE_AUTO`.  The option `ODMS_MISSING_VALUE_MEAN_MODE` replaces missing values with the mean (numeric attributes) or the mode (categorical attributes) both at build time and apply time where appropriate. The option `ODMS_MISSING_VALUE_AUTO` performs different strategies for different algorithms.  When `ODMS_MISSING_VALUE_TREATMENT` is set to `ODMS_MISSING_VALUE_DELETE_ROW`, the rows in the training data that contain missing values are deleted. However, if you want to replicate this missing value treatment in the scoring data, then you must perform the transformation explicitly.
    v_setlst('ODMS_MISSING_VALUE_TREATMENT') := 'ODMS_MISSING_VALUE_AUTO';


-- Specify the Neural Network architecture.  The default number of layers is 1, and the default activation function is NNET_ACTIVATIONS_LOG_SIG (Log Sigmoid). The default number of nodes per layer is the number of attributes or 50 (if the number of attributes > 50).  Be careful with quotes around NNET_ACTIVATIONS.
    v_setlst('NNET_HIDDEN_LAYERS') := '3';
    v_setlst('NNET_NODES_PER_LAYER') := '8,8,2';
    v_setlst('NNET_ACTIVATIONS') := '''NNET_ACTIVATIONS_TANH'', ''NNET_ACTIVATIONS_LOG_SIG'', ''NNET_ACTIVATIONS_ARCTAN''';

-- Specify the Heldaside options for Regularization. If the total number of training rows is greater than 50000, the default is NNET_REGULARIZER_HELDASIDE, otherwise it is NNET_REGULARIZER_NONE. The held ratio for the held-aside method is 0.25 by default. With NNET_REGULARIZER_HELDASIDE, the training process is stopped early if the network performance on the validation data fails to improve for NNET_HELDASIDE_MAX_FAIL epochs in a row (default is 6).
    v_setlst('NNET_REGULARIZER') := 'NNET_REGULARIZER_HELDASIDE';
    v_setlst('NNET_HELDASIDE_RATIO') := '0.25';
    v_setlst('NNET_HELDASIDE_MAX_FAIL') := '6';

-- Specify the L2 regularization parameter, with a default of 1. Cannot be used with NNET_REGULARIZER_HELDASIDE.
    v_setlst('NNET_REG_LAMBDA') := '1';

-- Specify the number of iterations, which is 200 by default for LBFGS solver and 10000 for the ADAM solver. The default convergence tolerance setting is 0.000001. 
    v_setlst('NNET_ITERATIONS') := '200';
    v_setlst('NNET_TOLERANCE') := '0.000001';
    v_setlst('ODMS_RANDOM_SEED') := '0';

-- Specify details on the LBFGS Solver. The number of historical copies kept in L-BFGS solver is defined by LBFGS_HISTORY_DEPTH. When the number of iterations is smaller than the history depth, the Hessian computed by L-BFGS is accurate, otherwise the Hessian computed by L-BFGS is an approximation. Typically, the value is between 3 and 10. 
    v_setlst('LBFGS_HISTORY_DEPTH') := '10';

-- Specify the gradient infinity norm tolerance for L-BFGS. The default value is 1E-9. 
    v_setlst('LBFGS_GRADIENT_TOLERANCE') := '0.0000001';

-- Specify how to set the initial approximation of the inverse Hessian at the beginning of each iteration. If the value is set to be LBFGS_SCALE_HESSIAN_ENABLE, then we approximate the initial inverse Hessian with Oren-Luenberger scaling. If it is set to be LBFGS_SCALE_HESSIAN_DISABLE, then we use identity as the approximation of the inverse Hessian at the beginning of each iteration    
    v_setlst('LBFGS_SCALE_HESSIAN') := 'LBFGS_SCALE_HESSIAN_ENABLE';
    v_setlst('LBFGS_SCALE_HESSIAN') := 'LBFGS_SCALE_HESSIAN_DISABLE';

